function checkIBAN(E){try{var F=(typeof (E)=="undefined")?(this.toUpperCase()):(E.toUpperCase());if(F.substring(0,2).toUpperCase()!="PL"){F="PL"+F}var K=F.length;if((K==undefined)||(K<8)){return false}var B=new String(F.substring(4,8)+F.substring(8,K)+F.substring(0,2)+F.substring(2,4));var D=new String("");var C;for(var G=0;G<K;++G){var L=B.charCodeAt(G);if((L>=65)&&(L<=90)){C=L-55}else{C=B.charAt(G)}D+=C}var J=D.length;var H=parseInt(D.substring(0,2),10);var A=H%97;for(G=2;G<J;++G){H=10*A+parseInt(D.substring(G,G+1),10);A=H%97}return(A==1)?((E.substr(0,2)=="RO")?(E.length==24):(true)):(false)}catch(I){return false}};